import React,{useState} from 'react'
import Topbar from '../../components/Topbar'
import Login from '../Login/Login'
function Home() {
  const [userLogged,setUserLogged] = useState(true)
  return (
    <div>
        <Topbar />
        {
          userLogged ? <> <h2> Welcome </h2> </> : <Login />
        }
    </div>
  )
}

export default Home
